USE mydatabase;

CREATE TABLE UserData(
    ID BIGINT NOT NULL PRIMARY KEY AUTO_INCREMENT,
    Woonplaats VARCHAR(255),
    Voornaam VARCHAR(100),
    Achternaam VARCHAR(100),
    Telefoonnummer VARCHAR(20),
    Email VARCHAR(255) NOT NULL UNIQUE,
    CREATED_AT DATETIME(6) DEFAULT NOW(6),
    UPDATED_AT DATETIME(6) DEFAULT NOW(6)
);

CREATE TABLE Reserveringen(
    ID BIGINT NOT NULL PRIMARY KEY AUTO_INCREMENT,
    ReserveringsID VARCHAR(255) UNIQUE NOT NULL,
    DatumAankomst DATETIME NOT NULL,
    DatumVertrek DATETIME NOT NULL,
    ReserveringsDatum DATETIME(6) NOT NULL DEFAULT NOW(6),
    UserDataID BIGINT NOT NULL,
    CREATED_AT DATETIME(6) DEFAULT NOW(6),
    UPDATED_AT DATETIME(6) DEFAULT NOW(6),
    FOREIGN KEY(UserDataID) REFERENCES UserData(ID) 
);


